import React, { useEffect, useRef } from "react";
import ReactDOM from 'react-dom/client';
import { AgCharts } from 'ag-charts-react';
import { useFetchOccupancyData } from "../Hooks/useFetchOccupancyData";
import { filterDataByKeyValue } from "../Utils/dataProcessing";
import { useAuth } from "../../AuthContext";

const OccupancyChart = ({ lgaName }) => {
    const { 
        userLocation, 
     } = useAuth();

    const rawData = useFetchOccupancyData();
    const filteredData = filterDataByKeyValue(rawData, lgaName, userLocation);

    const chartOptions = {
        data: Object.keys(filteredData).map(year => ({
            name: year,
            data: processedData[year],
        })),
        series: Object.keys(processedData).map(year => ({
            type: 'line',
            xKey: 'x',
            yKey: 'y',
            title: year,
        })),
        axes: [
            { type: 'time', position: 'bottom' },
            { type: 'number', position: 'left' },
        ],
    };

    return (
        <div style={{ height: '500px' }}>
            <AgCharts options={chartOptions} /> 
        </div>
    );


};

export default OccupancyChart;
